import React from 'react';
import logo from './logo.svg';
import './MainContainer.css';

function mainContainer(user) {
  return user.firstName + ' ' + user.lastName;
}
const user = {
  firstName: 'H',
  lastName: 'p'
}

const el = (
  <h1>
  Hello, { mainContainer(user)}!
  </h1>
)

export default mainContainer;
